    padding: '4vw 0 4vw 0',
}

const imageQuoteBlockInner = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    width: '80%',
}

const img = {
    height: '30vw',
    position: 'relative',
    left: '3vw',
}

const textBlock = {
    border: '1px solid rgb(166, 25, 46)',
    display: 'inline-block',
    justifyContent: 'center',
    alignItems: 'center',
    position: 'relative',
    padding: '2vw 3vw',
    top: '50px',
}

